官方网站http://maven.apache.org/

Maven Getting Started Guidehttp://maven.apache.org/guides/getting-started/index.html

Introduction to the Build Lifecyclehttps://maven.apache.org/guides/introduction/introduction-to-the-lifecycle.html

Lifecycle Referencehttps://maven.apache.org/guides/introduction/introduction-to-the-lifecycle.html#Lifecycle_Reference



