tools/repo/ossrh.html.body:
OSSRH
OSSRH 全称“Sonatype 开源软件仓库托管服务”（Sonatype&#39;s Open Source Software Repository Hosting service），它是个人开发者向中央仓库提交组件的首要渠道。
循序渐进

创建 JIRA 账号https://issues.sonatype.org/secure/Signup!default.jspa
JIRA 是 Atlassian 公司开发的项目管理工具系统，Sonatype 使用这一工具为 OSSRH 服务提供支持。

创建新的事务https://issues.sonatype.org/secure/CreateIssue.jspa?issuetype=21&amp;pid=10134
尔后，项目仓库将进入创建流程。官方承诺这项工作将在两个工作日内完成，并且声称一般会在几小时以内给予回复。注意：审核工作是人工完成的！@see http://central.sonatype.org/articles/2014/Feb/27/why-the-wait/


SEE

OSSRH Guidehttp://central.sonatype.org/pages/ossrh-guide.html

Individual Projects - Open Source Software Repository Hosting (OSSRH)http://central.sonatype.org/pages/producers.html#individual-projects-open-source-software-repository-hosting-ossrh


