Java™ Platform, Standard Edition 8, API Specificationhttp://docs.oracle.com/javase/8/docs/api/index.html

Java - Quick Guidehttp://www.tutorialspoint.com/java/java_quick_guide.htm

JAVA Tutorialhttp://wideskills.com/java-tutorial

A Quick, Painless Introduction to the Java Programming Languagehttp://heather.cs.ucdavis.edu/~matloff/Java/JavaIntro.htmlhttp://pdfsr.com/pdf/a-quick-painless-introduction-to-the-java-programming-language
这是加州大学戴维斯分校1计算机科学系教授 Norman S. Matloff 2005年的作品。


题外话
Norman Matloff
Matloff 热衷科普，自创了 Quick, Painless 的 IP，并撰写过不少入门教程，比如：

Professor Norm Matloff&#39;s Beginner&#39;s Guide to Installing Linuxhttp://heather.cs.ucdavis.edu/~matloff/linux.html

Fast Lane to PythonA quick, sensible route to the joys of Python codinghttp://heather.cs.ucdavis.edu/~matloff/Python/PLN/FastLanePython.pdf


如果生在中国，大概也会成为程序员圈子中的网红一枚。有趣的是，这位大咖对汉语颇有研究，还开发过一款汉语学习软件 KuaiXue，并且自称是混唐人街的：

Norman Matloff&#39;s Chinese Software Web Sitehttp://heather.cs.ucdavis.edu/chinese.htmlhttp://heather.cs.ucdavis.edu/~matloff/chinese.html  

在他的学校个人主页中，可以找到不少 Tutorial，可见这位教授对于时下各种热闹 IT 技术颇为在行:

Professor Matloff&#39;s Java Beginners&#39; Web Page
Norm Matloff&#39;s LATEX  Tutorial Site
Professor Norm Matloff&#39;s Beginner&#39;s Guide to Installing Linux
Norm Matloff&#39;s Quick Python Tutorials
Norm Matloff&#39;s Introduction to the Perl Language
Getting Started with the R Data Analysis Package
Norman Matloff&#39;s Unix and Linux Tutorial Center
Getting Started with Hadoop at UC Davis


1. “加州大学”并不是一所大学，而是由一个美国加利福尼亚州十所公立大学组成的系统，所谓的“分校”或“校区”才是真正意义上独立的大学。我们常听说的“加州大学伯克利分校”之于加州大学，某种程度上类似英国之于英联邦。戴维斯建校较晚（1959年），至今不能称百年，学术排名却常年稳居世界百强之列，实力不容小觑。 &#8617;


